export default function Header() {
    return (
        <div className="header-wrapper">
        <div className="text-wrapper">
            <span>---<h3>Your</h3> <h2>Personal</h2><h3>Recipes</h3>---</span>
        </div>

            <h4>Manage your own recipe collections</h4>
        </div>
    )
}
